import { Route, BrowserRouter as Router, Switch } from "react-router-dom";

const Login = () => {
    return (
        <div>
                        <h1>Welcome to App</h1>

            <button>Login</button>
        </div>
    );
};
const Dashboard = () => {
    return (
        <div>
            <h3>Dashboard</h3>
            <button>Dashboard</button>
        </div>
    );
};
function App() {
    return (
        <>
